import logo from './logo.svg';
import './App.css';

const App = () =>{
  return (
    <div className="App">
      <section className="side-bar">
        <button>+ New Chat</button>
        <ul className="history">
          <li>Chat 1</li>
          <li>Chat 2</li>
          <li>Chat 3</li>
        </ul>
        <nav>
          <p>Made By Baichuan</p>
        </nav>
      </section>
      <section className="main"></section>

    </div>
  );
}

export default App;
